import React from "react";
import { createBrowserRouter } from "react-router-dom";
import App from "./App";
import About from "./components/about/About";
import Login from "./components/login/Login";
import Contact from "./components/contact/Contact";
import Blog from "./components/blog/Blog";
import Pricing from "./components/pricing/Pricing";

import Home from "./components/home/Home";
import Signup from "./components/login/Signup";
import Services from "./components/common/footer/Services";
import Demo from "./components/home/Demo";
import Serve from "./components/common/footer/Serve";
import AdminLogin from "./components/login/AdminLogin";
import EmployeeLogin from "./components/login/EmployeeLogin";
import TermsAndConditions from "./components/common/footer/TermsAndConditions";
import PrivacyPolicy from "./components/common/footer/PrivacyPolicy";



const routing = createBrowserRouter([
    {
        path:"/",
        element:<App/>,
        children:[
            {
                path:"/",
                element:<Home/>,
            },
            {
                path:"about",
                element:<About/>,
                
            },
            {
                path:"pricing",
                element:<Pricing/>,
            },
            {
                path:"journal",
                element:<Blog/>,
            },
            {
                path:"contact",
                element:<Contact/>,
            },
            {
                path:"logins",
                element:<Login/>,
            },
            {
                path:"signup",
                element:<Signup/>,
            },
            {
                path:"adminlogin",
                element:<AdminLogin/>,
            },
            {
                path:"employeelogin",
                element:<EmployeeLogin/>,
            },
            {
                path:"services",
                element:<Serve/>,
            },
            {
                path:"demo",
                element:<Demo/>,
            },
            {
                path:"termsandconditions",
                element:<TermsAndConditions/>,
            },
            {
                path:"privacy",
                element:<PrivacyPolicy/>,
            },
            {
                path:"privacy",
                element:<PrivacyPolicy/>,
            },

            
        ]
    }
])

export default routing;
